import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const DATA = [
  { id: "todo-0", key: "0", name: "Eat", completed: true },
  { id: "todo-1", key: "1", name: "Sleep", completed: false },
  { id: "todo-2", key: "2", name: "Repeat", completed: false }
];

const DATA_FILTER = [
  { name: "All"},
  { name: "Done"},
  { name: "UnDone"},
]

ReactDOM.render(
  <App tasks={DATA} filter={DATA_FILTER}/>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
